import "./App.css";
import { Header } from "./components/header";
import { Balance } from "./components/balance";
import { History } from "./components/history";
import { Newtranscation } from "./components/newtransaction";

function App() {
  return (
    <>
      Hello World!
      <Header />
      <Balance balance = "234"/>
      <History />
      <Newtranscation />
    </>
  );
}

export default App;
